        var cardHeight = 94;
        return (
            <div class='Game'>
             <div class='Card' style={{width: {cardWidth}+'px', height: '94px', overflow: 'hidden'}}>
              <img src='https://img.itch.zone/aW1hZ2UvNzE1Mzg3LzM5NjQ5MzEucG5n/original/iwG3hK.png' alt='Cards' />
             </div>
             <p>The game board goes here</p>
            </div>
        );
    }
}
export default Game;
